def inputFolderPath=context.expand('${projectDir}')
inputFolderPath = inputFolderPath.replaceAll("\\n","/\n")
log.info inputFolderPath

File textFile = new File(inputFolderPath + "/smp.txt");
def String yourData= textFile.getText();
log.info yourData
testRunner.testCase.testSuite.setPropertyValue( "XMLFile", yourData )

new File(inputFolderPath).eachFile()
{f-> 
if (f.isFile()&& f.name.endsWith('.json')){
log.info f.getName()
log.info f
String fileContents = f.getText('UTF-8')
log.info fileContents
def jsonSlurper = new JsonSlurper()
def jsonObject = jsonSlurper.parseText(fileContents)
def a =jsonObject.properties.Header
def vo = jsonObject.properties.get("Items").get("Item").get(0)

for ( item in a ) {
    log.info item.key
    log.info item.value

}
testRunner.testCase.testSuite.setPropertyValue(item.key, item.value)
for (vitem  in vo){
	log.info vitem.key
     log.info vitem.value

}
testRunner.testCase.testSuite.setPropertyValue(vitem.key, String.valueOf(vitem.value))

testRunner.runTestStepByName("CreateRequest")
      def response = context.expand('${CreateRequest#Response}')
	log.info "response----------"+response
	def FSCResponse = new XmlSlurper().parseText(response)
	log.info "FSCResponse------"+FSCResponse
	def statusid=FSCResponse.TransactionStatus.text()
	log.info "statusid-------"+statusid
	def refid=FSCResponse.TransactionReferenceId.text()
	log.info "refid-------"+refid
	assert refid!=null
	def res
	if(statusid=="000")
    {
    	log.info "PASS"
    }
   else
   {
    	log.info "FAIL"
   }
    log.info "exp result"

  }

